// src/pages/Patients.jsx
import React, { useEffect, useState } from 'react';
import DashboardLayout from '../layouts/DashboardLayout';
import { getData, setData } from '../utils/localStorageHelpers';
import { v4 as uuid } from 'uuid';

function Patients() {
  const [patients, setPatients] = useState([]);
  const [form, setForm] = useState({
    id: '',
    name: '',
    dob: '',
    phone: '',
    email: '',
    health: ''
  });
  const [isEditing, setIsEditing] = useState(false);

  useEffect(() => {
    const data = getData('patients') || [];
    setPatients(data);
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    let updated;
    if (isEditing) {
      updated = patients.map(p => (p.id === form.id ? form : p));
    } else {
      updated = [...patients, { ...form, id: uuid() }];
    }
    setPatients(updated);
    setData('patients', updated);
    setForm({ id: '', name: '', dob: '', phone: '', email: '', health: '' });
    setIsEditing(false);
  };

  const handleEdit = (patient) => {
    setForm(patient);
    setIsEditing(true);
  };

  const handleDelete = (id) => {
    const updated = patients.filter(p => p.id !== id);
    setPatients(updated);
    setData('patients', updated);
  };

  return (
    <DashboardLayout>
      <div className="mb-6">
        <h2 className="text-xl font-bold mb-2">Manage Patients</h2>
        <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <input type="text" name="name" value={form.name} onChange={handleChange} placeholder="Full Name" required className="input" />
          <input type="date" name="dob" value={form.dob} onChange={handleChange} placeholder="DOB" required className="input" />
          <input type="text" name="phone" value={form.phone} onChange={handleChange} placeholder="Phone" required className="input" />
          <input type="email" name="email" value={form.email} onChange={handleChange} placeholder="Email" required className="input" />
          <textarea name="health" value={form.health} onChange={handleChange} placeholder="Health Info" className="input md:col-span-2"></textarea>
          <button type="submit" className="bg-blue-600 text-white px-4 py-2 rounded md:col-span-2">
            {isEditing ? 'Update' : 'Add'} Patient
          </button>
        </form>
      </div>

      <div className="bg-white rounded shadow p-4">
        <h3 className="text-lg font-semibold mb-3">Patient List</h3>
        {patients.length === 0 ? (
          <p>No patients added yet.</p>
        ) : (
          <table className="w-full table-auto text-sm">
            <thead>
              <tr className="bg-gray-100">
                <th className="px-2 py-1">Name</th>
                <th className="px-2 py-1">DOB</th>
                <th className="px-2 py-1">Phone</th>
                <th className="px-2 py-1">Email</th>
                <th className="px-2 py-1">Actions</th>
              </tr>
            </thead>
            <tbody>
              {patients.map((p) => (
                <tr key={p.id} className="border-t">
                  <td className="px-2 py-1">{p.name}</td>
                  <td className="px-2 py-1">{p.dob}</td>
                  <td className="px-2 py-1">{p.phone}</td>
                  <td className="px-2 py-1">{p.email}</td>
                  <td className="px-2 py-1 space-x-2">
                    <button onClick={() => handleEdit(p)} className="text-blue-600 hover:underline">Edit</button>
                    <button onClick={() => handleDelete(p.id)} className="text-red-500 hover:underline">Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </DashboardLayout>
  );
}

export default Patients;
